import styled from "styled-components";

export const SignInContainer = styled.div`
  color: purple;
`;

export const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
`;

export const BoldSpan = styled.span`
  font-weight: bold;
  font-size: 24px;
  color: red;
`;
